import { NgModule } from '@angular/core';
import { RouterModule, Routes } from '@angular/router';
import { BlogListComponent } from './pages/list/list.component';
import { BlogViewComponent } from './pages/view/view.component';
import { BlogEditComponent } from './pages/edit/edit.component';

const routes: Routes = [
  { path: '', component: BlogListComponent },               // /blog
  { path: 'new', component: BlogEditComponent },            // /blog/new
  { path: ':slug', component: BlogViewComponent },          // /blog/:slug
  { path: ':slug/edit', component: BlogEditComponent },     // /blog/:slug/edit
];

@NgModule({
  imports: [RouterModule.forChild(routes)],
  exports: [RouterModule],
})
export class BlogRoutingModule {}
